import {
  BrowserRouter as Router,
  Routes,
  Route
} from 'react-router-dom';
import NavBar from './components/NavBar';





function App() {


  return(
    <Router>
      <NavBar />
      <div className="container">
        <Routes>
          {routes.map((route)=>{
            return <Route path={route.path} component={route.component} />;
          })}
        </Routes>
      </div>
    </Router>
  );
}

export default App;



